import React from "react";
import '../css/homebody.css'

function HomeBody() {
  return(
    <div>
      <h3 className="home-body-title">Bem-vindo!</h3>
      <p className="home-body-text">
        Este é um espaço criado por <b> Gabryell Reis</b> para a atualização de seu portifólio pessoal. 
      </p>
      <p className="home-body-text">
      Acesse o menu no cabeçalho para acessar a página de Perfil ou Projetos.
      </p>
    </div>
  ) 
};

export default HomeBody;
